function State2(props){
    return(
        <div>
            <h2>Id={props.id}</h2>
            <h2>Sur={props.sur}</h2>
            <h2>Name={props.name}</h2>
            <h2>City={props.city}</h2>
        </div>
    )
}
export default State2;
